import React, { useState } from 'react';
import { ChevronLeftIcon, ChevronRightIcon } from '@heroicons/react/24/solid';

// Import watch images
import watch1 from '../assets/watch_banner_1_1764666960565.png';
import watch2 from '../assets/watch_banner_2_1764666980783.png';
import watch3 from '../assets/watch_banner_3_1764666995991.png';
import watch4 from '../assets/watch_banner_4_1764667012294.png';
import watch5 from '../assets/watch_banner_5_1764667034108.png';
import watch6 from '../assets/watch_banner_6_1764667050684.png';
import womensWatch1 from '../assets/womens_watch_1_1764669184082.png';

export default function MostLoved() {
    const [activeTab, setActiveTab] = useState('WOMEN');

    // Men's Collection
    const menWatches = [
        {
            id: 1,
            image: watch2,
            brand: 'VICTORINOX',
            model: 'Men | MAVERICK',
            price: '₹45800',
        },
        {
            id: 2,
            image: watch4,
            brand: 'TAG HEUER',
            model: 'Men | Carrera',
            price: '₹285000',
        },
        {
            id: 3,
            image: watch5,
            brand: 'FREDERIQUE CONSTANT',
            model: 'Men | Skeleton Heart Beat',
            price: '₹165000',
        },
        {
            id: 4,
            image: watch6,
            brand: 'OMEGA',
            model: 'Men | Seamaster Diver',
            price: '₹425000',
        },
        {
            id: 5,
            image: watch1,
            brand: 'LONGINES',
            model: 'Men | Master Collection',
            price: '₹125000',
        },
        {
            id: 6,
            image: watch3,
            brand: 'TISSOT',
            model: 'Men | Gentleman Powermatic',
            price: '₹68500',
        },
    ];

    // Women's Collection
    const womenWatches = [
        {
            id: 1,
            image: womensWatch1,
            brand: 'SWAROVSKI',
            model: 'Women | Crystalline...',
            price: '₹40000',
        },
        {
            id: 2,
            image: watch1,
            brand: 'VICTORINOX',
            model: 'Women | MAVERICK',
            price: '₹45800',
        },
        {
            id: 3,
            image: watch3,
            brand: 'MOVADO',
            model: 'Women | Bold',
            price: '₹63755',
        },
        {
            id: 4,
            image: watch4,
            brand: 'TISSOT',
            model: 'Women | Classic Dream',
            price: '₹35500',
        },
        {
            id: 5,
            image: watch6,
            brand: 'RADO',
            model: 'Women | Centrix',
            price: '₹89000',
        },
        {
            id: 6,
            image: watch5,
            brand: 'HAMILTON',
            model: 'Women | Jazzmaster',
            price: '₹72300',
        },
    ];

    const currentWatches = activeTab === 'MEN' ? menWatches : womenWatches;

    return (
        <section className="py-16 px-4 md:px-8 bg-white">
            <div className="max-w-7xl mx-auto">
                {/* Header with Navigation Arrows */}
                <div className="flex items-center justify-between mb-8">
                    <div className="flex-1"></div>

                    {/* Title */}
                    <h2 className="text-3xl md:text-4xl font-light tracking-wide text-cyan-500 text-center">
                        MOST LOVED WATCHES
                    </h2>

                    {/* Navigation Arrows */}
                    <div className="flex-1 flex justify-end gap-2">
                        <button className="w-10 h-10 flex items-center justify-center border border-gray-300 rounded hover:bg-gray-100 transition">
                            <ChevronLeftIcon className="w-5 h-5 text-gray-600" />
                        </button>
                        <button className="w-10 h-10 flex items-center justify-center border border-gray-300 rounded hover:bg-gray-100 transition">
                            <ChevronRightIcon className="w-5 h-5 text-gray-600" />
                        </button>
                    </div>
                </div>

                {/* Tabs */}
                <div className="flex justify-center gap-8 mb-12">
                    <button
                        onClick={() => setActiveTab('MEN')}
                        className={`text-lg font-medium pb-2 transition-all ${activeTab === 'MEN'
                                ? 'text-gray-800 border-b-2 border-gray-800'
                                : 'text-gray-400 hover:text-gray-600'
                            }`}
                    >
                        MEN
                    </button>
                    <button
                        onClick={() => setActiveTab('WOMEN')}
                        className={`text-lg font-medium pb-2 transition-all ${activeTab === 'WOMEN'
                                ? 'text-cyan-500 border-b-2 border-cyan-500'
                                : 'text-gray-400 hover:text-gray-600'
                            }`}
                    >
                        WOMEN
                    </button>
                </div>

                {/* Watch Grid */}
                <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-5 gap-6">
                    {currentWatches.slice(0, 5).map((watch, index) => (
                        <div
                            key={watch.id}
                            className="relative group bg-white rounded-lg shadow-md hover:shadow-xl transition-shadow duration-300 p-6 cursor-pointer"
                        >
                            {/* Large Number Overlay */}
                            <div className="absolute -top-4 -left-2 text-8xl font-bold text-cyan-500 opacity-20 select-none z-0">
                                {index + 1}
                            </div>

                            {/* Watch Image */}
                            <div className="relative z-10 mb-4 flex items-center justify-center h-48">
                                <img
                                    src={watch.image}
                                    alt={`${watch.brand} ${watch.model}`}
                                    className="w-full h-full object-contain drop-shadow-md group-hover:scale-105 transition-transform duration-300"
                                />
                            </div>

                            {/* Watch Details */}
                            <div className="relative z-10 text-center">
                                <h3 className="text-sm font-bold text-gray-800 mb-1">
                                    {watch.brand}
                                </h3>
                                <p className="text-xs text-gray-500 mb-3 truncate">
                                    {watch.model}
                                </p>
                                <p className="text-base font-semibold text-gray-900">
                                    {watch.price}
                                </p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
}
